import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="app-wrapper">
      <h1>Welcome to Marketing Secure</h1>
      <p>Empowering marketing professionals to defend against cyber threats.</p>
      <Link to="/topics">Start Learning</Link>
    </div>
  );
};

export default Home;
